import Clip from "./Clip";
import NewComment from "./NewComment";
import CommentList from "./CommentList";
import VideoList from "./VideoList";

//block__element--modifier--state

class App extends Component {
  render() {
    return (
      <div className="App">
        <Header />
        <Hero />
        <div className="section">
          <Clip />
          <NewComment />
          <CommentList />
        </div>
        <VideoList />
      </div>
    );
  }
}

export default App;
